import './App.css';

function App() {
  return (
    <div className="App">
      <title> My 401(k) Contributions </title>
      <h1> My 401(k) Contributions </h1>

      <h2>Set Contribution Type</h2>
      <h3>select how you would like to contribute to your 410k</h3>
      <div class="button-container">
  <button>Fixed Dollar Amount</button>
  <button>Percentage of Paycheck</button>
</div>

    </div>
  );
}

export default App;
